import { useCallback, useEffect } from "react";
import Navbar from "../components/SectionsNavbar";
import Experience from "../components/Experience";
import Skills from "../components/Skills";
import ProjectComponent from "../components/ProjectComponent";
import ContactForm from "../components/ContactForm";

const Main = () => {
  useEffect(() => {
    const scrollAnimElements = document.querySelectorAll(
      "[data-animate-on-scroll]"
    );
    const observer = new IntersectionObserver(
      (entries) => {
        for (const entry of entries) {
          if (entry.isIntersecting || entry.intersectionRatio > 0) {
            const targetElement = entry.target;
            targetElement.classList.add("animate");
            observer.unobserve(targetElement);
          }
        }
      },
      {
        threshold: 0.15,
      }
    );

    for (let i = 0; i < scrollAnimElements.length; i++) {
      observer.observe(scrollAnimElements[i]);
    }

    return () => {
      for (let i = 0; i < scrollAnimElements.length; i++) {
        observer.unobserve(scrollAnimElements[i]);
      }
    };
  }, []);



  const onImageContainerClick = useCallback(() => {
    window.open(
      "https://github.com/UMass-Amherst-Entrepreneurship-Club/Website-2.0"
    );
  }, []);

  const onImage7701Click = useCallback(() => {
    window.open("https://github.com/Shiven110504/FutureHacks-4");
  }, []);

  return (
    <div className="relative bg-primary-white w-full overflow-hidden flex flex-col items-center justify-start tracking-[normal]">
      <Navbar />
      <Experience />
      <Skills />
      <section
        className="self-stretch bg-primary-black overflow-hidden flex flex-col items-start justify-start py-[60px] pr-[97px] pl-20 box-border max-w-full text-left text-29xl text-primary-white font-heading-h6-semibold lg:pt-[25px] lg:pb-[25px] lg:box-border mq825:py-5 mq825:pr-12 mq825:pl-10 mq825:box-border mq450:pr-5 mq450:box-border mq1425:pt-[39px] mq1425:pb-[39px] mq1425:box-border"
        data-scroll-to="project"
      >
        <div className="self-stretch overflow-hidden flex flex-col items-start justify-start py-0 px-8 box-border gap-[20px] max-w-full">
          <div
            className="self-stretch overflow-hidden flex flex-row items-center justify-center py-5 px-0 gap-[16px] [&.animate]:animate-[1s_ease_0s_1_normal_forwards_fade-in-top] opacity-[0] mq450:flex-wrap"
            data-animate-on-scroll
          >
            <h1 className="m-0 relative text-inherit tracking-[-0.02em] leading-[56px] font-normal font-inherit mq825:text-19xl mq825:leading-[45px] mq450:text-10xl mq450:leading-[34px]">
              My
            </h1>
            <h1 className="m-0 relative text-inherit tracking-[-0.02em] leading-[56px] font-extrabold font-inherit mq825:text-19xl mq825:leading-[45px] mq450:text-10xl mq450:leading-[34px]">
              Projects
            </h1>
          </div>
          <ProjectComponent
            image771="/image-771@2x.png"
            prop="01"
            dailyDOSE="Daily D.O.S.E"
            dailyDOSEUnderstandsThatT="Daily D.O.S.E understands that the journey to optimal health is about consistent, incremental steps. Tailored to your unique health profile, it suggests achievable goals, nudging you towards slightly more challenging targets as you progress."
            developedAUserFriendlyEnd="Developed a user-friendly end to end application using Next.js backend framework and MongoDB database, resulting in a seamless and efficient tracking experience for users. Implemented a reinforcement learning model that analyzes user feedback to design personalized health goals, resulting in consistent progress towards optimal health for each individual user."
          />
          <ProjectComponent
            image771="/image-770@2x.png"
            prop="02"
            dailyDOSE="HackUMass XI "
            dailyDOSEUnderstandsThatT="Updated the frontend for HackUMass XI, to create a visually appealing and user-friendly interface. "
            developedAUserFriendlyEnd="Deployed and maintaining the Docker instance of fuse-umass dashboard to smoothly intake registrations, manage emailing, increasing initial participation by around 7%."
          />
          <div
            className="self-stretch overflow-hidden flex flex-row items-center justify-center py-5 px-0 box-border gap-[40px] [&.animate]:animate-[1s_ease_0s_1_normal_forwards_fade-in-left] opacity-[0] max-w-full mq825:gap-[20px] mq1425:flex-wrap"
            data-animate-on-scroll
          >
            <div
              className="w-[594px] h-[476px] overflow-hidden shrink-0 flex flex-row items-center justify-center min-w-[594px] max-w-full cursor-pointer lg:min-w-full mq1425:flex-1"
              onClick={onImageContainerClick}
            >
              <div className="relative rounded-[18.76px] w-[530px] h-[397.7px] flex items-center justify-center">
                <img
                  className="w-full h-full max-w-full object-contain absolute left-[0px] top-[12px] [transform:scale(1.191)] mq1425:flex-1"
                  loading="eager"
                  alt=""
                  src="/image-770-1@2x.png"
                />
              </div>
            </div>
            <div className="flex-1 overflow-hidden flex flex-col items-start justify-center min-w-[378px] max-w-full mq825:min-w-full">
              <div className="self-stretch flex flex-col items-start justify-start gap-[30px]">
                <div className="self-stretch relative tracking-[-0.02em] leading-[56px] font-extrabold mq825:text-19xl mq825:leading-[45px] mq450:text-10xl mq450:leading-[34px]">
                  03
                </div>
                <h1 className="m-0 self-stretch relative text-13xl tracking-[-0.02em] leading-[40px] font-bold font-inherit mq825:text-7xl mq825:leading-[32px] mq450:text-lgi mq450:leading-[24px]">{`UMass Entrepreneurship Club `}</h1>
                <div className="self-stretch relative text-base tracking-[0.02em] leading-[24px] text-zinc-500">
                  As the Director of Technology leading a team to build and
                  maintain the website of Entrepreneurship Club built using
                  React.js, Node.js, CSS, Three.js, HTML.
                </div>
                <img
                  className="relative w-5 h-5 hidden"
                  alt=""
                  src="/read-more.svg"
                />
              </div>
            </div>
          </div>
          <div
            className="self-stretch overflow-hidden flex flex-row items-center justify-center py-5 px-0 box-border gap-[40px] [&.animate]:animate-[1s_ease_0s_1_normal_forwards_fade-in-right] opacity-[0] max-w-full mq825:gap-[20px] mq1425:flex-wrap"
            data-animate-on-scroll
          >
            <div className="w-[594px] h-[476px] overflow-hidden shrink-0 flex flex-row items-center justify-center min-w-[594px] max-w-full lg:min-w-full mq1425:flex-1">
              <div className="relative rounded-[18.76px] w-[530px] h-[397.7px] cursor-pointer flex items-center justify-center">
                <img
                  className="w-full h-full max-w-full cursor-pointer object-contain absolute left-[0px] top-[12px] [transform:scale(1.191)] mq1425:flex-1"
                  loading="eager"
                  alt=""
                  src="/image-770-2@2x.png"
                  onClick={onImage7701Click}
                />
              </div>
            </div>
            <div className="flex-1 overflow-hidden flex flex-col items-start justify-center min-w-[378px] max-w-full mq825:min-w-full">
              <div className="self-stretch flex flex-col items-start justify-start gap-[28px]">
                <div className="self-stretch relative tracking-[-0.02em] leading-[56px] font-extrabold mq825:text-19xl mq825:leading-[45px] mq450:text-10xl mq450:leading-[34px]">
                  04
                </div>
                <h1 className="m-0 self-stretch relative text-13xl tracking-[-0.02em] leading-[40px] font-bold font-inherit mq825:text-7xl mq825:leading-[32px] mq450:text-lgi mq450:leading-[24px]">{`FutureHacks 4 `}</h1>
                <div className="self-stretch relative text-base tracking-[0.02em] leading-[24px] text-zinc-500">
                  <p className="m-0">
                    FutureHacks Four 2022 is an annual Online Free to Attend
                    International hackathon organized by AiGoLearning.
                  </p>
                  <p className="m-0">{`As the Director, I manage a team of 7 students, handle sponsorships, arrange workshops, preside meetings, set up deadlines, etc. `}</p>
                  <p className="m-0">
                    As the Technical Lead, I have coded the website, supervised
                    the designing of all social media posts, and set up the
                    other required infrastructure for hosting an online
